import React from 'react';

import './App.css';

function App() {
  return (
   <div className="wrapper with-image">
     <div className="flex-wrapper">
        <div className="flex-top-name">
            <div className="top-name">
              <h1>Sekolah Unggul</h1>
            </div>  
        </div>
     </div>
   </div>
  )
}

export default App;
